import React, { useState } from 'react';

export default function GetNextWeekMenu({ onMenuFetched }) {
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Function to fetch the raw menu data
  const fetchMenu = async () => {
    setLoading(true);
    setError(null);

    try {
      const response = await fetch('https://your-api-endpoint.com');
      if (!response.ok) {
        throw new Error(`Error: ${response.status}`);
      }

      const data = await response.json();

      // Send the raw data back to the parent
      onMenuFetched(data.body); // This will pass raw data to App.js
    } catch (error) {
      setError('Failed to fetch the menu. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div>
      <button onClick={fetchMenu} disabled={loading}>
        {loading ? 'Loading...' : 'Generate Menu'}
      </button>

      {error && <div style={{ color: 'red' }}>{error}</div>}
    </div>
  );
}
